const NavBar = () => {
    let pages = [
        {text: "Google", url: "https://www.google.com/"},
        {text: "Github", url: "https://www.github.com/"}
    ]

    let navItems = [];

    let i = 0;
    pages.forEach( ref => {
        navItems.push(<a key={i++} href={ref.url}> {ref.text} </a>)
    })
    
  return (
    <nav className="navBar">
        {navItems}
    </nav>
  )
}

export default NavBar
